import React from 'react'
import TagCloud from 'react-tagcloud';
const Tags = () => {
    const data=[
        {value:'Seoul', count:54},
        {value:'Jeju', count:86},
        {value:'China', count:95},
        {value:'USA', count:76},
        {value:'Japan', count:89},]
    return(<TagCloud minSize={5} maxSize={100} tags={data} conClick={tag=>alert(`'${tag.value}' was selected!`)}/>)

    }
export default Tags
